B.Z6=new A.bl("\xdaltima atualiza\xe7\xe3o: 16 de janeiro de 2026.\n\n1. ACEITA\xc7\xc3O DOS TERMOS\nAo criar uma conta ou utilizar o aplicativo Miaucaomigo, voc\xea declara que leu, compreendeu e concorda integralmente com estes Termos de Uso e com a nossa Pol\xedtica de Privacidade.\n\n2. OBJETIVO DO APLICATIVO\nO Miaucaomigo \xe9 uma plataforma de apoio \xe0 ado\xe7\xe3o respons\xe1vel de animais, permitindo o cadastro e a visualiza\xe7\xe3o de animais, bem como o compartilhamento de informa\xe7\xf5es sobre localiza\xe7\xe3o e cuidados, sempre priorizando o bem-estar animal.\n\n3. CADASTRO E RESPONSABILIDADE DO USU\xc1RIO\nO usu\xe1rio compromete-se a fornecer informa\xe7\xf5es verdadeiras, completas e atualizadas, utilizar apenas imagens e conte\xfados de sua autoria ou devidamente autorizados, e manter a confidencialidade de seus dados de acesso. O uso indevido da plataforma poder\xe1 resultar na suspens\xe3o ou exclus\xe3o da conta.\n\n4. CONTE\xdaDO INSERIDO PELO USU\xc1RIO\nTodo conte\xfado publicado no aplicativo \xe9 de inteira responsabilidade do usu\xe1rio. O Miaucaomigo n\xe3o se responsabiliza por informa\xe7\xf5es incorretas, imagens inadequadas ou a\xe7\xf5es tomadas por terceiros com base nesses dados.\n\n5. LOCALIZA\xc7\xc3O E REGISTROS\nO aplicativo pode utilizar dados de localiza\xe7\xe3o para indicar onde um animal foi avistado. Os registros possuem car\xe1ter tempor\xe1rio e podem expirar ap\xf3s determinado per\xedodo, com o objetivo de manter as informa\xe7\xf5es atualizadas.\n\n6. BEM-ESTAR ANIMAL E CONDUTAS PROIBIDAS\nO Miaucaomigo n\xe3o tolera qualquer forma de maus-tratos a animais. Den\xfancias ou ind\xedcios de abuso, neglig\xeancia ou uso indevido da plataforma poder\xe3o resultar no banimento imediato da conta.\n\n7. PRIVACIDADE E PROTE\xc7\xc3O DE DADOS\nOs dados pessoais coletados s\xe3o tratados conforme a Lei Geral de Prote\xe7\xe3o de Dados (Lei n\xba 13.709/2018 \u2013 LGPD) e de acordo com a nossa Pol\xedtica de Privacidade.\n\n8. LIMITA\xc7\xc3O DE RESPONSABILIDADE\nO Miaucaomigo atua como uma plataforma intermedi\xe1ria e n\xe3o garante a ado\xe7\xe3o efetiva dos animais, a veracidade absoluta das informa\xe7\xf5es fornecidas por usu\xe1rios ou a conduta de terceiros, ONGs ou adotantes.\n\n9. ALTERA\xc7\xd5ES DOS TERMOS\nEstes Termos de Uso podem ser atualizados a qualquer momento. O uso cont\xednuo do aplicativo ap\xf3s altera\xe7\xf5es implica na aceita\xe7\xe3o autom\xe1tica da vers\xe3o atualizada.\n\n10. CONTATO\nEm caso de d\xfavidas ou solicita\xe7\xf5es, entre em contato pelo e-mail: miaucaomigo@gmail.com",null,B.Y7,null,null,null,null,null,null)
